プレマシーH17年2月～、ロードスターH17年8月～、デミオH17年4月～などの主にオーディオレス車を対象としたマツダ車用配線キットになります。近年のマツダ24Pコネクター（車速信号取出し線付）に対応した製品です。 <br><br>■構成部品 ■.コネクター ■ほかに取付説明書を同梱（※取説は特定車種のオーディオレス車パネル部取外し図解説明であり、純正オーディオ付車の脱着方法は掲載しておりません。）<br><br>マツダの2D窓口付オーディオレス車はデッキ類など本体を固定する「純正ブラケット」が付いていない為、当キット単体での本体取付はできません。別途ディーラーにてマツダ純正部品の「（車種別）オーディオ取付キット」をお求めいただき、当キットと組合わせてご使用ください。 <br><br>マツダ車(24Pコネクター) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
