＜14mm前出し取付対応※＞マツダ車2D汎用キットです。適合車種はコネクターが(24P)のタイプ、年式はおおよそ（H12～H18年ごろ）で多岐にわたります。 <br><br>■構成部品 ■パネル（標準取付用） ■パネル（14mm前出し取付用） ■サイドブラケットx2 ■取付ケース ■リアブラケット ■コネクター(24P) ■カーラジオ取外し工具x4 ■ブッシュ ■M5x16バインドねじ ■M3x6バインドねじx4 ■ほかに取付説明書を同梱<br><br>※取付ける製品の奥行きがあり車両部品に干渉してしまう場合や、配線類が多く取付けが困難な場合などに、製品を通常より14mm前に出して取り付ける事がが可能です。パネルを2枚同梱し、標準位置取付け・14mm前出し取付けの選択が可能です。 <br><br>マツダ車(24Pコネクター) <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
