H17年2月にフルモデルチェンジし、新しくなったメルセデス・ベンツＡクラスの取付キットです。最大取付窓口サイズ(W173.5xH99.0)、２ＤＩＮサイズのオーディオはもちろん、専用の車速信号取出しコードを付属しナビゲーションの取付も可能です。 <br><br>■構成部品 ■専用パネル ■サイドブラケット（Ｌ） ■サイドブラケット（Ｒ） ■コネクター ■アンテナ変換アダプター ■アクセサリー取出しコード ■イルミネーション取出しコード ■タップ（赤） ■タップ（茶） ■結束バンド ■.車速信号取出しコード ■ほかに取付説明書を同梱<br><br>※適応年式はH17年2月～H20/8となります。H20年8月20日にマイナーチェンジがあり、以降のＡ/Ｂクラスは、車両側アンテナの仕様が変更された為、KJ-G98DEでの取付は不可となります。（ラジオが受信できません） <br><br>メルセデス・ベンツ W169 Ａクラス　※H18年1月新発売のＢクラスにも対応 <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
