新しいホンダ車2D汎用キットです。電源コネクターは24Pコネクター、アンテナ変換コネクターが新しい「CE」タイプとなっています。24Pコネクターから「車速信号」の取出しも可能。１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品　■パネル(黒)　■スポンジテープ　■サイドブラケット(L)　■サイドブラケット(R)　■コネクター(24P)　■アンテナ変換コネクター(CE→JASO2P)　■M5x8ねじ(8本)　■φ5x10ねじ（8本）　■ほかに取付説明書を同梱<br><br>※1.「Honda HDDインターナビシステム」付車は、車両パネルやハーネスの仕様が異なるため、取付けできません。※2.「C」タイプに設定されている「AM/FMチューナー付CDプレーヤー（1Dサイズ）」付車、オーディオレス車、その他オプションの純正オーディオ（ナビゲーション）付車は、ハーネスの仕様が異なるため、取付けできません。※3.トレードイン取付ができますが、標準装備のリアカメラ等、純正オーディオ関連の機能は使用できなくなります <br><br>インサイト オーディオレス車 <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
