H19年12月にフルモデルチェンジされたタント／タントカスタム(L375S/L385S)の「インテグレートオーディオ（異形ラジオ）付車」、「オーディオレス車」両対応の取付キットです。標準装備の異形ラジオを外して、トレードイン取付が可能。また、オーディオレス車にも追加部品不要で取付ができます。オプションコネクターから車速信号・バック信号・パーキング信号の取出しが可能で、１Ｄ＋１Ｄ～２ＤＩＮサイズのオーディオ、ナビゲーションなどの本体取付が可能です。 <br><br>■構成部品 ■専用パネル（シルバー） ■ブラケット（Ｌ） ■ブラケット（Ｒ） ■コネクター(10P) ■コネクター(6P) ■コネクター(5P) ■アンテナ電源変換コード ■タッピングねじx4 ■ほかに取付説明書を同梱<br><br> <br><br>L375S/L385S タント／タントカスタム <br><br>　車検対応品<br><br>カーオーディオ、ビジュアル/配線・取付金具<tr><td colspan="2">
